    false,nt"url": null,nt"notes": "During 2006 and 2007 the Alaska Division
    of Geological & Geophysical Surveys conducted reconnaissance surficial-geologic
    mapping in segment 1 of the Alaska Highway corridor, which straddles the Alaska
    Highway through the Tanana River valley from Delta Junction to the eastern boundary
    of the Mt. Hayes Quadrangle. Surficial-geologic deposits were initially mapped by
    interpreting ~1:63,360-scale, false-color infrared aerial photographs taken in August
    1980 and field verified in 2006-2007.",nt"license_title": null,nt"extras":
